import React from 'react'
import {DateRangePicker} from 'rsuite'
import './Date.css'
// import 'rsuite/dist/styles/rsuite-default.css'

const DateRange = () => {
    return (
        <div className="dates">
            <h1>From Date range</h1>
            <DateRangePicker/>
        </div>
    )
}

export default DateRange
